import React from 'react';
import Card from './Card';
import Sdata from './Sdata';
const App=()=>(
    <>
    <h1 className='heading_style'>List of 5 netflix Series in 2020</h1>
    {Sdata.map((val) =>{
      return(
            <Card 
            key={val.id}
            imgsrc={val.imgsrc}
            title={val.title}
            sname= {val.sname}
            link={val.link}/>  
      );
})}
    </>
);
export default App;
